import React from 'react';
import './Middle.css'
import gameTitle from './GameTitle.png';

const Middle = () => {

    return (
        <div className="top-section">
          <img src={gameTitle} alt='game title' className='gameTitle'/>
      </div>
    )
}

export default Middle
